(function($){
	jQuery.fn.dragChildrens=function(options){
		options=$.extend({
			top: true,
			bottom: false,
			left: true,
			right: false
		},options);
		var frame=this;
		var top=options.top;
		var bottom=options.bottom;
		var left=options.left;
		var right=options.right;
		var w, h;
		frame.children()
			.drag('start',function(){
				w=frame.width();
				h=frame.height();
			})
			.drag(function (ev,dd) {
				if(right) {
					$(this).css({'right':(100-100*dd.offsetX/w).toFixed(2)+'%'});
				} else {
					$(this).css({'left':(100*dd.offsetX/w).toFixed(2)+'%'});
				}
				if(bottom) {
					$(this).css({'bottom':(100-100*dd.offsetY/h).toFixed(2)+'%'});
				} else {
					$(this).css({'top':(100*dd.offsetY/h).toFixed(2)+'%'});
				}
			},{relative:true})
			.bind('click',function(){
				return false;
			});
	};
})(jQuery);

